import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Fitness from './Fitness/Fitness';

const App = (props) => {

  return (
    <Router> 
      <Switch>
        <Route exact path = '/' component = {Navig}></Route>
        <Route path = '/fitness' component = {Fitness}></Route>
      </Switch>
    </Router>
  );

}

export default App;
